<head>

    <style type="text/css">
    @import url('https://fonts.googleapis.com/css2?family=Inter:wght@100;400;500;700&display=swap');

    html {
        -webkit-box-sizing: border-box;
        box-sizing: border-box;
        -moz-box-sizing: border-box;
        height: 100%
    }

    *,
    :before,
    :after {
        -webkit-box-sizing: inherit;
        box-sizing: inherit;
        -moz-box-sizing: inherit
    }

    * {
        box-sizing: border-box;
        outline: none;
        margin: 0;
        padding: 0;
    }

    input {
        border: none;
        outline: none;
    }

    a {
        text-decoration: none;
        outline: none;
        color: inherit
    }

    body {
        font-family: 'Inter';
        font-weight: 400;
        height: 100%;
        direction: ltr;
        text-align: center;
        color: #fff;
        background: #000;
    }

    header img {
        position: absolute;
        top: 0;
        left: 0;
    }

    .button {
        /* display: flex; */
        align-items: center;
        position: absolute;
        top: 60%;
        /*left: 50%;*/
        /*transform: translate(-50%, -2%);*/
        width: 100%;
        background: #000000;
        height: 25vh;
    }

    .banner {
        height: 40vh;
        width: 100%;
        z-index: -1;
        position: relative;
    }

    header {
        background: #000;
    }

    .banner img {
        width: 100%;
        /* height: 130%; */
        position: absolute;
        top: -79px;
        left: 0;
    }

    .age {
        height: 40px;
        float: right;
        right: 0;
        padding: 7px 5px;
        border: 2px solid #fff;
        width: 40px;
        border-radius: 50px;
        top: 0;
        position: absolute;
        margin: 15px;
    }

    .top_txt {
        padding-top: 65px;
    }

    main img {
        width: 100vw;
    }

    h1 {
        /*font-size: 23px;*/
        font-size: 5.75vw;
        font-weight: 700;
    }

    h2 {
        /*font-size: 20px;*/
        font-size: 5vw;
        font-weight: 400;
        padding-bottom: 15px;
    }

    .btn {
        width: calc(100vw - 20vw);
        margin: 0 auto;
        background: #9A57DB;
        /*box-shadow: 0 4px 2px 0 #3e1c66;*/
        border-radius: 500px;
/*        height: 18vw;
        line-height: 17vw;*/
        color: #fff;
        /* font-size: 28px; */
        font-size: 26px;
        font-weight: bold;
        padding: 0 50px 0 0;
        margin: 15px auto;
        border: 0;
            height: 11vh;
                line-height: 16vw;
    max-height: 106px;
    min-height: 70px;
    box-shadow: 0px 5px 0px 0px rgb(62 28 102);
    }

    .btn img {
            width: 19vw;
    padding: 0vw 0 0 2vw;
        position: absolute;
    }

    .close {
        border: 1px solid #fff;
        width: calc(100vw - 70vw);
        margin: 0 auto;
        border-radius: 50px;
        padding: 4px 0;
        /*font-size: 16px;*/
        font-size: 4vw;
        font-weight: normal;
    }

    footer {
        position: absolute;
        bottom: 10px;
        padding-top: 5px;
        border-top: 1px solid #323232;
    }

    h3 {
        /*font-size: 14px;*/
        font-size: 3.5vw;
        font-weight: normal;
        color: #D6D6D6;
    }

    a {
        text-decoration: underline;
        color: #D6D6D6;
    }

     }

                top: -80px;
        }
    }

    @media (orientation: portrait) and (max-width: 360px) and (max-height: 570px) {
        .age {
    height: 30px;
    padding: 5px 2px;
    width: 30px;
    margin: 8px;
    font-size: 13px;
}

        header img {
            width: 40%;
        }

        .top_txt {
            padding-top: 45px;
        }

        h2 {
            margin-bottom: 10px;
        }

        .btn {
            margin: 8px auto;
        }

        .banner img {
            top: -110px;
        }

        .button {
            top: 64%;
        }
    }
    @media (orientation: portrait) and (max-width: 325px) and (min-height: 550px) {
        .button{
            top: 60%;
        }
                .banner img{
                top: -80px;
        }
    }
        @media (orientation: portrait) and (max-width: 325px) and (min-height: 571px) {
        .button{
            top: 55%;

                .banner img{

    }
            @media (orientation: portrait) and (max-width: 325px) and (min-height: 641px) {
        .button{
            top: 53%;
        }
                .banner img{
                top: -80px;
        }
    }

    @media only screen and (orientation: landscape) {
        main img {
            display: none;
        }

        .btn img {
            display: inherit;
            width: 13vh;
            padding: 3vh 0 0 1vh;
        }

        h1 {

            /* font-size: 28px; */
            font-size: 7vh;
            padding: 0 50px 0 0;
            margin: 15px auto;
        }

        .close {
            width: calc(100vw - 80vw);
            margin: 0 auto;
            padding: 4px 0;
            /* font-size: 16px; */
            font-size: 4vh;
        }

        h3 {
            font-size: 3.4vh;
            font-weight: normal;
            color: #D6D6D6;
            width: 100vw;
        }

        .button {
            top: 30%;
        }

        .age {
            height: 30px;
            padding: 3px 1px;
            width: 30px;
            margin: 10px;
            font-size: 14px;
        }

        header img {
            width: 20%;
        }

        .top_txt {
